import React, { Component } from 'react';
import { MDBContainer, MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavbarToggler, MDBCollapse, MDBNavbarItem, MDBNavbarLink, MDBIcon } from 'mdb-react-ui-kit';
import {Link} from "react-router-dom";

export class Header extends Component {
    constructor(props) {
        super(props);
        this.state = {
            showBasic: false,
        };
        this.onClick = this.onClick.bind(this);
    }
  
    onClick() {
        this.setState({
            showBasic: !this.state.collapse,
        });
    }

    render() {
        return (
            <header>
                <MDBNavbar bgColor="primary"  dark expand="md" scrolling fixed="top">
                    <MDBContainer>
                        <MDBNavbarBrand>
                            <strong>Navbar</strong>
                        </MDBNavbarBrand>

                        <MDBNavbarToggler
                            aria-controls='navbarSupportedContent'
                            aria-expanded='false'
                            aria-label='Toggle navigation'
                            onClick={() => this.onClick}
                            >
                            <MDBIcon icon='bars' fas />
                        </MDBNavbarToggler>

                        <MDBCollapse navbar show={this.state.showBasic}>
                            <MDBNavbarNav className='mr-auto mb-2 mb-lg-0'>
                                <MDBNavbarItem>
                                    <MDBNavbarLink active aria-current='page' to="/">
                                        <Link to="/">
                                            Home
                                        </Link>
                                    </MDBNavbarLink>
                                </MDBNavbarItem>

                                <MDBNavbarItem>
                                    <MDBNavbarLink active aria-current='page' 
                                        to="/about">
                                        About
                                    </MDBNavbarLink>
                                </MDBNavbarItem>
                            </MDBNavbarNav>
                        </MDBCollapse>
                    </MDBContainer>
                </MDBNavbar>
          </header>
        )
    }
}

export default Header
